import { Text, View } from "../Themed"
import { GlobalButton } from "../Button"
import { Title } from "../Title"
import { TextInput } from "react-native"
import { useState } from "react"
import { global } from "../../style/styles"
export const ModalLoginCode = () => {
    const [Code, setCode] = useState("")
    const [NewPW, setNewPW] = useState("")

    const Validate = (() => {
        console.log(Code, NewPW)
      })

    return (
        <View style={global.container}>
            <View style={global.titleContainer}>
            <GlobalButton onPress={() => setOpen(!Open)} title='Hide Modal'>
            </GlobalButton>
            <Title title='Code de verification'></Title>
            </View>
          <Text>Rest Password</Text>
          <TextInput
            onChangeText={setCode}
            value={Code}
            placeholder="Code"
            keyboardType="numeric"

          />
          <TextInput
            onChangeText={setNewPW}
            value={setNewPW}
            placeholder="set new Password"
          />
            <GlobalButton
            title='Validate'
            onPress={Validate}
            >
          </GlobalButton>
          <Text >Code : {Code}</Text>

        </View>
    )
}
